package May_15;

public class Pattern_cube {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int size = 5;

		for (int i = 1; i <= size; i++) {
			for (int j = 1; j <= size; j++) {
				System.out.print("* ");
			}
			System.out.println();
		}

	}

//Ctrl + Shift +F

}
